import React from "react";
import { BrowserRouter, Routes, Route } from "react-router-dom";

import First from "./First";
import Seconds from "./Seconds";

import "./App.css";
import "./reset.css";

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<First />}></Route>
        <Route path="/seconds" element={<Seconds />}></Route>
      </Routes>
    </BrowserRouter>
  );
}

export default App;
